    // Function to wait until a predicate is true
    function waitUntil(predicate, success, error) {
        var int = setInterval(function() {
            if (predicate()) {
                clearInterval(int);
                int = null;
                success();
            }
        }, 33);
        setTimeout(function() {
            if (int !== null) {
                clearInterval(int);
                if (typeof(error) === 'function') {
                    error();
                }
            }
        }, 10000);
    }

