    const parsePrice = (price) => {
      const [currency, amount] = price.replace(',','').split(/([^\d.])/).filter(Boolean);
    
      let [dollars, cents] = amount ? amount.split('.').map(part => parseInt(part)) : price.split('.').map(part => parseInt(part));
      cents = cents !== undefined ? cents.toString().padStart(2, '0') : '00';
    
      return {
        currency: currency,
        dollars: dollars,
        cents: cents
      };
    }

    const annualPriceCalc = (price)=>{
      const numberPart = parseFloat(price.replace(/[^\d.]/g, ''));
      const result = (numberPart / 12).toFixed(2);
      return result
    }

