    const waitForCheckoutPage = (selector, trigger, delayInterval, delayTimeout)=> {
      const interval = setInterval(()=> {
        if (
          document &&
          document.querySelector(selector) &&
          document.querySelectorAll(selector).length > 0
        ) {
          clearInterval(interval);
          trigger();
        }
      }, delayInterval);
      setTimeout(()=> {
        clearInterval(interval);
      }, delayTimeout);
    }

